/* Useful postresql queries:
  SELECT *
  SELECT COUNT(*) AS alias --number of records from table including 'null' and match condition
  SELECT COUNT(column) AS alias --number of records from column which not 'null' and match condition
  SELECT MIN(column) AS alias --min value of 'column'
  SELECT MAX(column) AS alias --max value of 'column'
  SELECT SUM(column) AS alias --total sum of NUMERIC column values, 'null' values are ignored
  SELECT AVG(column) AS alias --average value of a NUMERIC column, 'null' values are ignored
  SELECT col_1, col_2, ...
  SELECT col_1 AS alias_name_1, col_2, ...
  SELECT DISTINCT col_1, col_2 --return only different(unique) records of columns
  SELECT alias_table_name.col_1, alias_table_name.col_2
  FROM table AS alias_table_name
  FROM table
  WHERE condition_1 AND condition_2 OR condition_3 AND NOT condition_4
  WHERE column IS NULL
  WHERE column IS NOT NULL
  WHERE column LIKE 'pattern'
  WHERE column NOT LIKE 'pattern'
    -- % -> zero or more chars
    -- _ -> one char
    -- [chars] -> one of chars: abc, a-c, ^abc <-> !abc
  WHERE column BETWEEN value1 AND value2 --col >= val1 AND col <= val2
  WHERE column NOT BETWEEN value1 AND value2
  WHERE column IN (value1, value2, ...) --col = val1 OR col = val2
  WHERE column NOT IN (value1, value2, ...)
  GROUP BY column_1, column_2, ... --group and returns one record for each group and
    --often used with: COUNT, MAX, MIN, SUM, AVG
  HAVING condition // work with grouped records, after GROUP BY, can have aggregate function
  ORDER BY column_1 ASC, column_2 <-> ORDER BY column_1, column_2 --'null' in the end
  ORDER BY column_1 DESC --sorted records where 'null' in the begin
  LIMIT number; --number of records to return from DB

  SELECT column_name(s)
  FROM table_1
  INNER JOIN table_2 --return records that match in both tables
  LEFT JOIN table_2 --return all records from table_1 and matching from table_2 or NULL
  RIGHT JOIN table_2 --return all records from table_2 and matching from table_1 or NULL
  FULL OUTER JOIN table_2 --return all records from table_1 and table_2. No match -> NULL
  ON table_1.column_name = table_2.column_name; --primary key = foreign key

  --combine a set of results of 2 ro more SELECT. Number of columns must be equal and have similar data types:
  SELECT column(s) FROM table_1 WHERE condition1
  UNION --selects only different values
  UNION ALL --allows to select repeated values
  SELECT column(s) FROM table_2 WHERE condition2;

  --merging 2 columns into 1 column which called 'alias':
  SELECT column_name(s), CONCAT(column_1, 'text', column_2) AS alias
  FROM table;
  --group by column_1 and merging column_1 and column_2 into column called 'alias':
  SELECT CONCAT(column_1, 'text', COUNT(column_2)) AS alias
  FROM table
  GROUP BY column_1;
  --return numeric value part from date. Use with: SELECT, WHERE, GROUP BY, ORDER BY:
  EXTRACT(part FROM date)
    --part: SECOND, MINUTE, HOUR, DAY, MONTH, YEAR
    --date: column_date, CURRENT_DATE, CURRENT_TIME, CURRENT_TIMESTAMP
  --return 'true' if subquery returns 1 or more records. Usually used with WHERE:
  EXISTS(SELECT column FROM table WHERE condition)
  --return one of result, like if-elseif-else:
  CASE
    WHEN condition_1 THEN result_1
    WHEN condition_2 THEN result_2
    ELSE result_3 --when ommit and all condition is false then return 'NULL'
  END
  --return not NULL values from 'column' otherwise return 'value':
  COALESCE(column, value)
    SELECT col_1 * (col_2 + col_3) AS alias; --if one of col_3 values = NULL then result = NULL
    SELECT col_1 * (col_2 + COALESCE(col_3, value)) AS alias;
  --return NULL value if arg_1 equals to arg_2, otherwise it returns arg_1:
  NULLIF(arg_1, arg_2)

  -- inserte new record (columns weren't specified will receive 'null' or autocomplete):
  INSERT INTO table (column_1, column_2, ...)
  VALUES (value_1, value_2, ...);
  -- inserting new record for all columns:
  INSERT INTO table
  VALUES (value_1, value_2, ...);

  --update an existing record
  UPDATE table
  SET column_1=value_1, column_2=value_2, ...
  WHERE condition; --which records to update, if miss then all records will be updated

  --insert a new row into the table if it doesnt exists, otherwise update the row
  INSERT INTO table_name(column_list)
  VALUES(value_list)
  ON CONFLICT (column_name) action;
    --action: DO NOTHING; DO UPDATE SET column_1 = EXCLUDED.column_1, ... WHERE condition

  --delete an existing record
  DELETE FROM table
  WHERE condition; --which records to delete, if miss then all records will be deleted

  --copy records from one table to NEW table:
  SELECT * --all columns will be copied
  SELECT column_1 AS alias, column_2, ... --selected columns will be copied
  INTO newTable
  INTO newTable IN 'external.mdb'
  FROM someTable
  WHERE condition
  WHERE 1=0; --create new empty table based on another
  --copy records from one table to NEW table:
  CREATE TABLE newTable AS
  SELECT * --all columns will be copied
  SELECT column_1 AS alias, column_2, ... --selected columns will be copied
  FROM someTable
  WHERE condition
  WHERE 1=0; --create new empty table based on another

  --copy records from table_1 to table_2:
  INSERT INTO table_2
  SELECT *
  SELECT column(s) --columns weren't specified will receive 'null' or autocomplete
  FROM table_1
  WHERE condition;

  --Create database. Must be admin rights:
  CREATE DATABASE database_name;
  --list of databases:
  SHOW DATABASES;
  --Delete database. Must be admin rights:
  DROP DATABASE database_name;

  --Create new table:
  CREATE TABLE table_name (
    id SERIAL PRIMARY KEY, --autoincrement primary key with integer datatype
    id uuid PRIMARY KEY DEFAULT gen_random_uuid (), --automatically generate primary key with uuid datatype
    column_1 datatype constraint_1 constraint_2,
    column_2 CONSTRAINT name constraint_3, --named constraint for the column
    ...
    CONSTRAINT name constraint_4, --named constraint for the table
    ...
    UNIQUE (column_1, column_2), --COMBINATION of values in columns is unique
    PRIMARY KEY (column_1, column_2), --primary keys can span more than one column
    FOREIGN KEY (column_1, column_2) REFERENCES other_table (column_3, column_4),
    CHECK (column_1 operator_1 column_2 AND column_3 operator_2 value),
  );
    --constraints:
      --NOT NULL
      --UNIQUE
      --PRIMARY KEY
      --REFERENCES other_table <-> REFERENCES other_table (column_PRIMARY_KEY)
      --REFERENCES other_table ON DELETE NO ACTION --default. Thow error when child record cant find parent record (in next checked transaction)
      --REFERENCES other_table ON DELETE RESTRICT --prevents delete parent record if exist child record
      --REFERENCES other_table ON DELETE CASCADE --if delete parent record then also delete child record
      --REFERENCES other_table ON DELETE SET NULL --if delete parent record then child record set to NULL
      --REFERENCES other_table ON DELETE SET DEFAULT --if delete parent record then child record set to default
      --REFERENCES other_table ON UPDATE CASCADE --if update parent record then also update child record
      --CHECK (this_column operator value) --satisfied if check expression evaluates to true or NULL value (NULL operator value --> NULL)
      --DEFAULT value --set a default value for a column. Where value: number, string, NOW(), ...
  --Delete table:
  DROP TABLE table_name;
  --Delete the data inside a table, but not the table itself:
  TRUNCATE TABLE table_name;

  ALTER TABLE table_name
  ADD COLUMN column_name datatype constraint --add a column in a table
  DROP COLUMN column_name --delete a column in a table
  RENAME COLUMN old_name TO new_name --rename a column in a table
  ALTER COLUMN column_name TYPE new_datatype --change the datatype of column
  ALTER COLUMN column_name SET NOT NULL --change NOT NULL constraint of column
  ALTER COLUMN column_name DROP NOT NULL --delete NOT NULL constraint of column
  ADD CONSTRAINT name UNIQUE (column_name(s)) --add a UNIQUE constraint of column(s)
  DROP CONSTRAINT name --delete a UNIQUE constraint by name
  ADD PRIMARY KEY (column_name(s)) --add a PRIMARY KEY constraint to column(s)
  ADD FOREIGN KEY (column_name(s)) REFERENCES other_table (column_name(s))
  ADD CONSTRAINT name CHECK (expression(s)) --add a CHECK constraint of table
  DROP CONSTRAINT name --delete a CHECK constraint by name
  ALTER COLUMN column_name SET DEFAULT value --set a new default for a column
  ALTER COLUMN column_name DROP DEFAULT --delete a default value of column

  --datatype:
    --numeric:
      smallint <-> int2, integer <-> int|int4, bigint <-> int8 --2,4,8 bytes integer with sign + or -
      numeric [(p, s)] <-> decimal [(p, s)] --variable numeric of selectable precision and scale
      real <-> float4, double precision <-> float8 --4,8 bytes floating-point with variable-precision, inexact
      smallserial <-> serial2, serial <-> serial4, bigserial <-> serial8 --2,4,8 bytes autoincrementing integer
    --character:
      character varying [(n)] <-> varchar [(n)] --variable-length character string
      character [(n)] <-> char [(n)] --fixed-length character string, space-padded
      text --variable-length character string(isnt in SQL standard)
        --'n' is string length and equel 0..10485760.
        --If not specified: in 'varchar' then string is of any size, in 'char' then char(1)
    --date/time:
      timestamp [ without time zone ], timestamp with time zone --both date and time
      time [ without time zone ], time with time zone --time of day
      date --calendar date (year, month, day)
        --INSERT to column: type 'value'
    --boolean: boolean
      --INSERT to column: TRUE, FALSE, NULL::boolean <-> CAST ( NULL AS boolean ) (state: unknown)
    --binary: bytea
    --json: json, jsonb
    --uuid: uuid
    --array: integer[] <-> integer ARRAY
      --INSERT array to column: '{number, "string"}' <-> ARRAY[number, 'string']
*/
